import { Component ,OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-edit-client',
  templateUrl: './edit-client.component.html',
  styleUrls: ['./edit-client.component.css']
})
export class EditClientComponent implements OnInit {
  id:number=0;
  name:String='';
  email:String='';
  address:String='';
  password:String='';
  repeatPassword:String='';
  meetingTopic:String='';
  numberOfPeople:number=0;
  startTime:String='';
  message:string='';
  constructor(private http:HttpClient,private route:ActivatedRoute,private router:Router){}
  ngOnInit(): void {
    this.route.paramMap.subscribe(params=>{
      const idParam=params.get('client_id');
      if(idParam!== null){
        this.id=+idParam;
        this.fetchClient();
      }
      else{
        console.log("id is missing or null");
      }
    })
  }
  fetchClient(){
    this.http.get('http://localhost:3000/getClient/:id'+this.id).subscribe((response:any)=>
    {
      const client=response[0];
      this.name=client.name,
    this.email=client.email,
    this.address=client.address,
   this.password=client. password,
    this.repeatPassword=client.repeat_password,
    this.meetingTopic=client.meeting_topic,
    this.numberOfPeople=client.number_of_people,
    this.startTime=client.start_time;
    },
    (error)=>{console.error('Error fetching the Client Details',error);}
    )
  }

  updatedSchedule(){
    const client={
      client_id:this.id,
    name:this.name,
    email:this.email,
    address:this.address,
    password:this.password,
    repeat_password:this.repeatPassword,
    meeting_topic:this.meetingTopic,
    number_of_people:this.numberOfPeople,
    start_time:this.startTime
    }
    this.http.put('http://localhost:3000/updateClient',client).subscribe((response:any)=>
    {
      this.message=response.message;
      this.router.navigate(['/view'])
    },

    (error)=>{console.error('Error Updating the Client Details',error);}
    )
  }

}
<h1>Edited Client Schedule</h1>
<div>
    <label> <b>Id</b></label><br>
    <input type="text" name="id" Placeholder="Enter Id" [(ngModel)]="id"/>
</div>
<div>
    <label> <b>Name</b></label><br>
    <input type="text" name="name" Placeholder="Enter Name" [(ngModel)]="name"/>
</div>
<div>
    <label> <b>Email</b></label><br>
    <input type="email" name="email" Placeholder="Enter Email" [(ngModel)]="email"/>  
</div>
<div>
    <label> <b>Address</b></label><br>
    <input type="text" name="address" Placeholder="Enter Address" [(ngModel)]="address"/>
</div>
<div>
    <label> <b>Password</b></label><br>
    <input type="password" name="password" Placeholder="Enter Password" [(ngModel)]="password"/>
</div>
<div>
    <label> <b>Repeat Password</b></label><br>
    <input type="password" name="repeat-password" Placeholder="Repeat password" [(ngModel)]="repeatPassword"/>
</div> 

<h1><b>Create a Meeting Schedule</b></h1>
<div>
    <label> <b>Meeting Topic</b></label><br>
    <input type="text" name="meeting-topic" Placeholder="Enter Meeting Topic" [(ngModel)]="meetingTopic"/>
</div>
<div>
    <label> <b>Number Of People</b></label><br>
    <input type="number" name="Number-Of-People" Placeholder="Enter Number Of People" [(ngModel)]="numberOfPeople"/>
</div>
<div>
    <label> <b>Start Time</b></label><br>
    <input type="datetime-local" name="start-Time"  [(ngModel)]="startTime"/>
</div>
<button name="register" (click)="updatedSchedule()">UpdatedSchedule</button>
<h4 name="message">{{message}}</h4>
